import React from 'react';

const EmbedCode: React.FC<{ formCode: string }> = ({ formCode }) => {
    return (
        <div>
            <h2>Embed Code</h2>
            <textarea
                readOnly
                value={formCode}
                rows={10}
                cols={50}
                style={{ width: '100%', fontFamily: 'monospace' }}
            />
            <button onClick={() => navigator.clipboard.writeText(formCode)}>
                Copy to Clipboard
            </button>
        </div>
    );
};

export default EmbedCode;
